import React from 'react';
import Navbar from '../navSection/Navbar';
import SearchBar from '../component/SearchBar';

function Product() {
  return (
    <div style>
      <Navbar />
      <div>
        <div className='my- m-auto' style={{width:"80%", position:"absolute", top:0, left:0}}>
          <SearchBar/>
        </div>
      </div>
    </div>
  );
}

export default Product;
